import styled from "@emotion/styled";

export const HeaderContainer = styled.div`
  width: 100%;
  text-align: center;
  background: #2cd3e6;
  padding-top: 2.2rem;
`;

export const Header = styled.div`
  display: flex;
  margin: auto;
  color: #fff;
  font-size: 1.8rem;
  font-weight: bold;
  text-align: center;
  padding-bottom: 2.2rem;
  letter-spacing: 0.1rem;
`;

export const BackSpace = styled.div`
  font-weight: 700;
  font-size: 2rem;
`;
